  graphWL() {
	   const wl_data = this.state.wl_data;
	   const station_name = wl_data.station_name;
	   const dev_id = wl_data.device_id;
	   const mun = wl_data.mun;
	   const prov = wl_data.prov;
	   const last_date = wl_data.llast_date;
	   const right_bank = wl_data.rright_bank;
	   const left_bank = wl_data.lleft_bank;
	   const min_wl = wl_data.min_wl;
	   const max_wl = wl_data.max_wl;
	   const tick_val = wl_data.tick_val;
	   const actual_wl = wl_data.actual_wl;
	   const assumed_msl = wl_data.assumed_msl;
	   
	    let fDate1 = actual_wl[0][0];
		let fDate = Highcharts.dateFormat("%m/%d/%Y %H:%M", fDate1);
		let lDate1 = actual_wl[actual_wl.length - 1][0];
		let lDate = Highcharts.dateFormat("%m/%d/%Y %H:%M", lDate1);
		let init = 0,
			limit = 0;
		for (let k = 0; k < tidal_data.length; k++) {
			if (tidal_data[k][0] === fDate) {
				init = k;
			}
			if (tidal_data[k][0] === lDate) {
				limit = k;
			}
		}
		let tidal_val = [];
		let limit_len = limit + 1;
		for (let i = init; i < limit_len; i++) {
			let c = tidal_data[i][0];
			let d = c.match(/(\d{2})\/(\d{2})\/(\d{4}) (\d{2}):(\d{2})/);
			tidal_val.push([Date.UTC(+d[3], d[1] - 1, +d[2], +d[4], +d[5]), tidal_data[i][1]])
		}
	   
	   Highcharts.chart('chart-wrapper', {
	    chart: {
				type: "line",
				height: 400,
				alignTicks: false,
				spacingBottom: 15,
				spacingTop: 10,
				spacingLeft: 10,
				spacingRight: 10,
				style: {
					fontFamily: 'Arial,Helvetica Neue,Helvetica,sans-serif'
				}
			},
			credits: false,
			title: {
				text: 'Water Level at ' + station_name + ', ' + mun + ', ' + prov + ' as of ' + last_date
			},
			subtitle: {
				text: 'Source: DOST-ASTI',
				x: -20
			},
			xAxis: {
				type: "datetime",
				labels: {
					formatter: function() {
						return Highcharts.dateFormat("%b %e, %Y %I:%M %p", this.value);
					},
					dateTimeLabelFormats: {
						hour: "%I:%M",
						minute: "%I:%M %p",
						day: "%e. %b",
						week: "%e. %b",
						month: "%b '%y",
						year: "%Y"
					},
					padding: 5,
					align: "center",
					style: {
						fontSize: "10px"
					}
				}
			},
			tooltip: {
				formatter: function() {
					return Highcharts.dateFormat("%b %e, %Y %I:%M %p", new Date(this.x)) + "<br/>" + this.series.name + ": <b>" + this.y + " m</b>"
				},
				style: {
					fontSize: "11px"
				}
			},
			yAxis: [{
					title: {
						text: "Water Level, m"
					},
					plotLines: [{
							value: right_bank,
							color: '#800000',
							dashStyle: 'shortdash',
							width: 2,
							label: {
								text: assumed_msl === 'no' ? 'RIGHT BANK SPILLING LEVEL ' + right_bank + ' M. from MSL' : 'RIGHT BANK SPILLING LEVEL ' + right_bank + ' M.',
								align: 'right',
								style: {
									color: '#800000'
								}
							}
						},
						{
							value: left_bank,
							color: '#cccc00',
							dashStyle: 'shortdash',
							width: 2,
							label: {
								text:  assumed_msl === 'no' ? 'LEFT BANK SPILLING LEVEL: ' + left_bank + ' M. from MSL' : 'LEFT BANK SPILLING LEVEL: ' + left_bank + ' M.',
								align: 'left',
								style: {
									color: '#cccc00'
								}

							}
						}
					],
					min: min_wl,
					max: max_wl,
					tickInterval: tick_val
				},
				{
					min: min_wl,
					max: max_wl,
					tickInterval: tick_val,
					plotLines: [{
						value: 0,
						width: 1,
						color: "#808080"
					}],
					title: {
						text: "Predicted Tide at Butuan Bay, m"
					},
					opposite: !0
				}
			],
			series: [{
					name: "Actual/Recorded Water Level",
					data: actual_wl,
					tooltip: {
						valueSuffix: " m"
					},
					color: "#0000FF"
				},
				{
					name: "Predicted Tide at Butuan Bay",
					data: tidal_val,
					tooltip: {
						valueSuffix: " m"
					},
					color: "#ADD8E6"
				},
			],
			exporting: {
				enabled: true,
				sourceWidth: 900,
				sourceHeight: 470,
				filename: station_name,
				buttons: {
					contextButton: {
						menuItems: null,
						onclick: function() {
							this.exportChart();
						}
					}
				}
			}
		}, function(chart) {
			if(dev_id !== 594){
				let series = chart.series[1];
				let yAxis = chart.yAxis[1];
				series.showInLegend = false;
				series.update({ showInLegend: false});
				yAxis.update({ visible: false});
				//chart.redraw();
			}
		})
  }
  
